$(document).ready(function(){$(".btn-primary").click(function(){var i=this.id,t=i.split("_")[1],e="#question_"+("back"==i.split("_")[2]?parseInt(t)-1:parseInt(t)+1).toString();$(".question_div").not(e).hide(),$(e).show();$(".input-btn-primary:visible").each(function(){var i=$(this)[0].form.action.split("&");console.log($(this)[0].form.action);var t=(new Date).toISOString();i[3]="start_time="+t;var e=i.join("&");$(this)[0].form.action=e,console.log($(this)[0].form.action)})}),$(window).keydown(function(i){switch(i.keyCode){case 37:var t=$(".question_div:visible").attr("id");$("#"+t+"_no").trigger("click");break;case 38:t=$(".question_div:visible").attr("id");$("#"+t+"_back").trigger("click");break;case 39:t=$(".question_div:visible").attr("id");$("#"+t+"_yes").trigger("click");break;case 40:t=$(".question_div:visible").attr("id");$("#"+t+"_uncertain").trigger("click")}})});